const MainNavigation = () => {
    return (
        <header className={classes.header}>
            <div className={classes.logo}>Great Quotes</div>
            <nav className= {classes.nav}>
                <ul>
                    <li><NavLink to ='/quotes' activeclassname={classes.active}>All Quotes</NavLink>
                    </li>
                    <li><NavLink to ='/new-quotes' activeclassname={classes.active}>Add a Quote</NavLink>
                    </li>
                </ul>
            </nav>
        </header>
    )
};

export default MainNavigation;
